import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { format } from 'date-fns';
import './AuditLogViewer.css';

function AuditLogViewer() {
  const [logs, setLogs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filters, setFilters] = useState({
    operation_type: '',
    file_path_filter: '',
    limit: 100
  });

  useEffect(() => {
    fetchLogs();
  }, [filters]);

  const fetchLogs = async () => {
    setLoading(true);
    try {
      const params = new URLSearchParams();
      if (filters.operation_type) params.append('operation_type', filters.operation_type);
      if (filters.file_path_filter) params.append('file_path_filter', filters.file_path_filter);
      params.append('limit', filters.limit);

      const response = await axios.get(`/api/audit/logs?${params}`);
      setLogs(response.data.logs);
    } catch (error) {
      console.error('Failed to fetch audit logs:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleFilterChange = (field, value) => {
    setFilters(prev => ({ ...prev, [field]: value }));
  };

  const getOperationTypeColor = (type) => {
    switch (type) {
      case 'CREATE': return '#10b981';
      case 'MODIFY': return '#f59e0b';
      case 'DELETE': return '#ef4444';
      case 'RENAME': return '#8b5cf6';
      default: return '#94a3b8';
    }
  };

  return (
    <div className="audit-log-viewer">
      <div className="audit-header">
        <h2>Audit Logs</h2>
        <div className="audit-filters">
          <select
            value={filters.operation_type}
            onChange={(e) => handleFilterChange('operation_type', e.target.value)}
            className="filter-select"
          >
            <option value="">All Operations</option>
            <option value="CREATE">CREATE</option>
            <option value="MODIFY">MODIFY</option>
            <option value="DELETE">DELETE</option>
            <option value="RENAME">RENAME</option>
            <option value="WRITE">WRITE</option>
          </select>
          
          <input
            type="text"
            placeholder="Filter by path..."
            value={filters.file_path_filter}
            onChange={(e) => handleFilterChange('file_path_filter', e.target.value)}
            className="filter-input"
          />
          
          <select
            value={filters.limit}
            onChange={(e) => handleFilterChange('limit', parseInt(e.target.value))}
            className="filter-select"
          >
            <option value={50}>50 logs</option>
            <option value={100}>100 logs</option>
            <option value={200}>200 logs</option>
            <option value={500}>500 logs</option>
          </select>
        </div>
      </div>

      <div className="audit-table-container">
        {loading ? (
          <div className="loading">Loading audit logs...</div>
        ) : logs.length === 0 ? (
          <div className="no-logs">No audit logs found</div>
        ) : (
          <table className="audit-table">
            <thead>
              <tr>
                <th>Timestamp</th>
                <th>User</th>
                <th>Operation</th>
                <th>Path</th>
                <th>Type</th>
              </tr>
            </thead>
            <tbody>
              {logs.map(log => (
                <tr key={log.id}>
                  <td className="timestamp-cell">
                    {format(new Date(log.timestamp * 1000), 'MMM d, yyyy h:mm:ss a')}
                  </td>
                  <td className="user-cell">
                    {log.username || <span className="no-user">System</span>}
                  </td>
                  <td>
                    <span
                      className="operation-badge"
                      style={{ backgroundColor: getOperationTypeColor(log.operation_type) + '20', color: getOperationTypeColor(log.operation_type) }}
                    >
                      {log.operation_type}
                    </span>
                  </td>
                  <td className="path-cell" title={log.file_path}>
                    {log.file_path}
                  </td>
                  <td>
                    {log.is_directory ? 'Directory' : 'File'}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}

export default AuditLogViewer;
